INSERT INTO `problems` VALUES ('2025-08-08 15:32:19.163821',23,20,'바다거북수프','남자는 과거 조난당해 섬에 표류했을 때 동료의 시신을 \'바다거북 수프\'라고 속이고 먹었었다. 이후 레스토랑에서 진짜 수프를 맛본 그는 이전에 먹었던 것이 사람이었다는 사실을 깨닫고 자살했다.','한 남자가, 어느 바닷가 레스토랑에서 바다거북 수프를 한 수저 먹고는 주방장을 불렀습니다. “죄송합니다. 이거 정말로 바다거북 수프인가요?”\n“네, 틀림없는 바다거북 수프 맞습니다.”\n남자는 계산을 마친 뒤 집에 돌아가서 자살했습니다.\n왜 그랬을까요?','ORIGINAL',NULL),('2025-08-08 15:47:34.764272',23,21,'엄마의 말','A는 전날 밤 귀가 중 누군가의 인기척을 느끼고 이어폰을 뺐지만, 뒤를 돌아봤을 때 아무 일도 없었다. 다음 날 엄마는 \'같은 학교 학생이 어젯밤 그 길에서 납치당할 뻔했다\'는 소식을 들려주었다. A는 자신이 그 피해자였을 수도 있다는 사실에 소름이 돋은 것이다.','몇 년 전, 고등학생 A는 야자가 끝나고 혼자 집으로 가는 길이었다. 그런데 다음 날, 집에서 밥을 먹다 엄마가 해준 말에 A는 갑자기 소름이 돋았다. 엄마는 무슨 말을 했던 걸까?','ORIGINAL',NULL),('2025-08-08 15:47:49.498236',23,22,'엄마의 말','A는 전날 밤 귀가 중 누군가의 인기척을 느끼고 이어폰을 뺐지만, 뒤를 돌아봤을 때 아무 일도 없었다. 다음 날 엄마는 \'같은 학교 학생이 어젯밤 그 길에서 납치당할 뻔했다\'는 소식을 들려주었다. A는 자신이 그 피해자였을 수도 있다는 사실에 소름이 돋은 것이다.','몇 년 전, 고등학생 A는 야자가 끝나고 혼자 집으로 가는 길이었다. 그런데 다음 날, 집에서 밥을 먹다 엄마가 해준 말에 A는 갑자기 소름이 돋았다. 엄마는 무슨 말을 했던 걸까?','ORIGINAL',NULL),('2025-08-08 15:53:19.510192',23,23,'경찰과 지도','한 아이가 토막살인을 당한 사건이 있었고, 경찰은 아이의 시신이 발견된 장소들을 지도에 표시하며 설명하고 있었다. 그런데 여성이 그 지점을 보자마자, 자신이 최근에 갔던 장소들과 일치함을 깨닫고 큰 충격에 빠져 쓰러진 것이다.','한 여성이 경찰과 함께 지도를 보고 있었다. 경찰과 이야기를 나누던 여성은 얼마 지나지 않아 충격을 받은 듯 쓰러지고 말았다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 15:55:52.413139',23,24,'친구의 생일','과거 A, B, C는 조난을 당해 극한의 상황에서 팔을 잘라 생존했다. 이때 B와 C는 맹인인 A를 속이고 A의 팔만 먹고, 자신들도 팔을 잘랐다고 거짓말했다. 시간이 흘러 A는 생일파티에서 축하를 받으며 그들의 거짓말을 떠올렸고, 분노를 이기지 못해 그들을 살해했다.','A, B, C는 오랜 친구 사이이다. A의 생일날, A는 B와 C를 집으로 초대했다. B와 C는 선물을 주고, 생일축하 노래를 부르며 진심으로 축하해주었다. 그런데 그 직후, A는 갑자기 B와 C를 살해했다. 무슨 이유였을까?','ORIGINAL',NULL),('2025-08-08 15:56:36.818156',23,25,'텔레비전','끈으로 작동하는 선풍기를 켜 두었는데, 누군가 끈을 당기는 소리가 들린 뒤 선풍기가 꺼졌다. A는 집에 자신 외에 누군가 있다는 것을 직감하고, 두려움에 방 밖으로 나가지 못한 것이다.','더운 여름날 오후, 혼자 안방에서 텔레비전을 보고 있던 A는 저녁 7시까지 단 한 발자국도 방 밖으로 나가지 못했다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 15:58:22.950819',23,26,'전화번호','남자는 빚에 시달리며 삶을 비관하던 중, 전화를 걸었다. 수화기 너머에서는 큰 굉음이 들렸고, 뒤이어 ‘보험금으로 새로운 인생을 살아가라’는 말이 들려왔다. 그 굉음은 남자의 부모가 탄 차가 원격 폭탄에 의해 터진 소리였고, 보험금을 남기기 위한 것이었다. 이 사실을 깨달은 남자는 충격과 자책에 자살했다.','실패한 인생에 좌절하던 남자는 어느 날, \'인생을 바꿔주겠다\'는 말과 함께 전화번호가 적힌 쪽지를 받는다. 반신반의하며 전화를 건 그는, 이후 곧바로 자살했다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 15:58:52.177459',23,27,'식재료','A는 아이와 집에서 숨바꼭질을 하던 중이었다. 술에 취해 있던 A는 냉장고에 식재료가 없다는 사실을 인지하지 못했고, 이후 식탁에 냉장고에 있어야 할 식재료들이 올라온 것을 보고 아이가 냉장고에 들어갔음을 깨달아 충격을 받은 것이다.','A는 식탁에 올려진 식재료들을 보자 갑자기 새파랗게 질렸다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:00:14.577096',23,28,'도시락','남자는 자가용 비행기를 타고 비행 중 엔진 고장으로 낙하산을 메고 탈출했다. 낙하산이 들어 있어야 할 배낭에서 도시락이 나오는 것을 보고, 배낭을 바꿔 든 것을 깨닫고 절망한 것이다.','한 남자가 배낭에서 도시락을 꺼낸 순간, 자신이 곧 죽을 것이라는 사실을 깨달았다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:03:15.959376',23,29,'철수와 영희','영희는 철수를 납치한 범인이며, 철수의 부모는 철수를 찾기 위해 계속해서 언론에 호소하고 있었다. 그런 상황을 알면서도 영희가 아무렇지 않게 말을 건네자, 철수는 깊은 슬픔에 빠진 것이다.','철수의 부모님은 TV에 나와 연일 대중의 입방아에 오르고 있었다. 이를 본 영희는 철수에게 \"너희 부모님 또 뉴스에 나와!\"라고 말했다. 그런데 철수는 그 말을 듣고 더 슬퍼졌다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:47:18.402229',23,30,'서점','남자의 집 근처에서 서점 공사가 한창이었고, 소음 때문에 매우 괴로웠다. 서점이 곧 오픈한다는 말은 공사도 곧 끝난다는 의미였고, 남자는 그 소식에 기뻐했던 것이다.','남자는 집 근처에 서점이 시일 내에 오픈한다는 소식을 듣고 무척 기뻐했다. 그런데 막상 서점이 문을 열었을 때, 그는 그곳에 전혀 가지 않았다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 16:47:38.430821',23,31,'미술관','A는 야근 도중, 어두운 전시실에서 그림 액자를 하나 봤다. 그런데 다음 날 다시 그 자리를 확인한 그는, 그 자리에 액자가 없고 단순한 창문이 있다는 걸 깨달았다. 누군가 창밖에서 자신을 지켜보고 있었음을 깨달은 A는 두려움에 사직했다.','미술관 신입 경비원 A는 야근을 마치고 불을 끈 뒤 퇴근했다. 그런데 다음날 출근한 그는 갑자기 사직서를 제출했다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:49:54.291148',23,32,'늑대인간','늑대인간은 밤이 되면 마을 안으로 숨어들어 공격했다. 소문이 퍼지기 전에는 사람들은 마을 안에 머물러 있었고, 그 결과 희생자가 많았다. 그러나 소문을 들은 마을 사람들은 오히려 밤이 되면 마을에서 멀리 떨어진 곳으로 피신했고, 이 덕분에 공격을 피할 수 있었기 때문에 밤에 밖으로 나가는 사람이 늘어난 것이다.','A마을에는 밤마다 늑대인간이 나타나 마을 사람을 공격한다는 소문이 돌기 시작했다. 그런데 이상하게도, 그 소문이 퍼지고 나서 오히려 밤에 마을 밖으로 나가는 사람들이 늘었다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 16:50:14.225226',23,33,'새해','그 남자는 타임슬립을 통해 미래에서 온 인물이며, 사람들의 수명을 볼 수 있는 능력이 있었다. 그가 말한 숫자는 실제 나이가 아니라 사망까지 남은 시간, 즉 수명이었다. 곧 지하철에 사고가 나서 탑승객 전원이 사망할 예정이었고, 그 사실을 간접적으로 깨달은 주인공은 공포에 질린 것이다.','새해가 되기 10분 전, 지하철을 타고 가던 중 낯선 남자가 다가와 \"당신의 나이는 22세죠?\"라고 물었다. 나는 놀라며 \"네, 맞습니다\"라고 대답했다. 남자는 옆 사람에게도 정확한 나이를 맞췄고, 그 순간 내 얼굴은 새파랗게 질렸다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 16:51:14.575324',23,34,'외딴 집','그 집 안의 벽과 바닥에는 나와 친구의 이름이 똑같이, 여러 번 써져 있었다. 이는 우리를 이미 알고 있던 누군가가 존재하며, 그 집이 단순한 우연이 아닌 위험한 장소임을 암시했기 때문에 우리는 공포에 질려 도망쳤던 것이다.','나는 친구와 함께 집 근처 산에서 놀다가 길을 잃고 말았다. 한참을 헤매던 우리는 멀리 불이 켜진 외딴 집을 발견했고, 지푸라기라도 잡는 심정으로 그 집으로 향했다. 그런데 열린 문으로 들어가자마자 우리는 패닉 상태로 그대로 뛰쳐나왔다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:51:37.907203',23,35,'산장여행','A는 사진이라고 생각했던 것들이 사실은 창문이었고, 그 창문 너머에서 누군가 자신을 지켜보고 있었던 것이다. 이 사실을 깨달은 A는 공포에 질려 기절할 뻔한 것이다.','A는 혼자 산장으로 여행을 떠났다. 산장 안 벽에는 여러 사진들이 가지런히 붙어 있었고, A는 사진 속 인물들을 구경하다가 잠들었다. 그런데 다음 날 눈을 뜬 A는 기절할 뻔했다. 무슨 일이 있었던 걸까?','ORIGINAL',NULL),('2025-08-08 16:58:56.085426',23,36,'주차장','남자는 자살하려고 건물에서 투신할 예정이었고, 자신이 떨어질 장소 아래에 아이가 있어 위험하다고 생각해 경고한 것이다. 아이를 피하게 한 뒤 그는 곧바로 투신해 목숨을 잃었다.','\"거기서 놀고 있으면 위험해\"\n한 남자가 주차장에서 놀고 있던 아이에게 말을 걸었습니다.\n그리고 몇 초 후, 그는 죽었습니다.\n왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:03:17.938696',23,37,'지하실','사실 철수는 선천적 장애로 인해 지하실에 갇혀 살아왔다. 철수가 열어본 문은 지하실에서 나가는 문이었고, 그 너머엔 자신을 속이고 평범하게 살아가던 가족의 모습이 있었다.','철수는 부모님과 함께 살고 있었다. 부모님은 외출할 때마다 철수에게 지하실 문을 절대 열어보지 말라고 했다. 14번째 생일날, 혼자 남겨진 철수는 호기심을 참지 못하고 지하실 문을 열고, 그 너머를 보고 충격에 빠져 실어증에 걸리고 만다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:05:32.099623',23,38,'엘리베이터','남편은 심장병으로 인해 전기 의료기구에 의존해 살고 있었고, 여자가 귀가하며 엘리베이터가 정지된 걸 본 순간 건물 전체가 정전된 것을 알게 되었다. 이에 따라 남편이 사망했음을 직감한 것이다.','여자는 귀가하기 위해 엘리베이터를 타려다, 자신의 남편이 죽은 것을 깨달았다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:06:27.715775',23,39,'고층건물','남자가 사는 층은 고층인데, 물에 잠겨 떠오른 시체가 창문에 부딪히며 손이 흔들리는 모습이 인사처럼 보였기 때문이다.','한 남자는 어떤 이유로 밖으로 나가지도 못하고 집에만 있다. 남자가 무심코 창문을 봤다가 어떤 사람이 자기에게 손을 흔들며 인사하고 있는 장면을 목격한다. 그 모습을 본 남자는 두려움에 떨다가 기절한다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:06:40.434351',23,40,'안무가','안무가가 한 손으로 바닥을 짚고 물구나무를 서는 듯한 동작을 하자, 복도 너머 천장에 붙어 있던 귀신이 그의 춤을 따라하며 웃고 있는 모습과 눈이 마주쳤기 때문이다.','남자는 유명한 안무가이다. 오늘도 늦게까지 연습실에 남아서 안무를 짜고 있었다. 열심히 춤을 추던 그는 무언가를 깨닫고 기절했다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:08:01.969184',23,41,'불','A는 등대지기였다. 어느 날, 등대를 켜지 않고 TV를 보던 그는 뉴스에서 자신이 불을 켜지 않아 조난당한 배들이 침몰했다는 소식을 듣게 된다. 죄책감을 느낀 그는 등대의 불을 켠 뒤, 자살한다.','A는 방에서 불을 다 끄고 티비를 보고 있었다. 잠시 후 A는 방의 불을 켜고, 자살했다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:09:10.845177',23,42,'크리스마스','아이는 오른손과 왼발이 하나 더 많은 기형아였다. 친구들이 손발이 다른 그 아이를 멀리하자 아이는 절제 수술을 원했지만, 가난으로 수술을 할 수 없었다. 그러던 중, 크리스마스를 맞아 \'산타가 선물을 주러 온다\'는 말에 친구가 생기기를 소원했고, 다음날 절단된 채 발견되어 병원으로 이송되었다. 수술 덕분에 목숨을 건지고, 신체도 아이들과 같아져 친구도 생기게 되었다.','크리스마스 이브의 밤, 어떤 아이가 산타에게 친구가 가지고 싶다는 소원을 빌며 잠들었다. 다음날 눈을 떠보니 아이의 오른손과 왼발이 절단된 채 침대에는 피 응덩이가 생겨있었다. 아이는 바로 병원으로 이송되어 어떻게든 목숨은 건질 수는 있었다. 어떻게 된 일일까?','ORIGINAL',NULL),('2025-08-08 17:09:26.978481',23,43,'테스트','이건 컴퓨터 수업으로, 질문은 \'자신의 패스워드를 입력하세요\'였다. 정답을 쓴 학생은 자신의 비밀번호를 노출한 셈이라 정보보안 원칙을 어긴 것이다. 수업 중 선생님은 \'비밀번호는 타인에게 알려주면 안 된다\'고 강조했으며, 이를 기억하고 답하지 않은 학생이 진정으로 수업을 이해한 것이었다.','수업의 마지막에 선생님은 확인 테스트를 실시했다. 하지만 제대로 대답한 학생에게는 X를, 잘못된 답을 쓴 학생이나 대답을 쓰지 않은 학생에게는 O를 주었다. \"선생님, 그거 반대 아니에요?\" 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:10:08.276178',23,44,'절망','A는 살인 피해자, B는 형사이다. A가 죽기 직전 범인의 정보를 바닷가 모래에 다잉메시지로 남겼는데, 파도에 휩쓸려 그 글씨가 지워지고 말았다. 형사는 그 사실을 깨닫고 절망한 것이다.','A가 바다를 가리키고 있다. B는 그 쪽을 바라보고 절망한다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:10:24.772414',23,45,'밤손님','도둑은 자전거를 훔쳐 도주했는데, 그 자전거는 브레이크가 고장나 있었다. 빠르게 달리던 자전거는 커브를 돌지 못하고 절벽 가드레일을 넘어서 추락한 것이다.','한 도둑이 있었다. 도둑은 도둑질에 성공했음에도 절벽에서 뛰어내려 사망했다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:11:26.188809',23,46,'코골이','평소 며느리에게 까다롭게 굴던 시어머니가 살을 빼라며 며느리를 강요해왔고, 며느리는 배가 고파 모두가 잠든 줄 알고 밥을 급히 먹었다. 하지만 뒤에서 코고는 소리를 내며 지켜보고 있던 시어머니를 발견하고 기절한 것이다.','나는 밤에 몹시 배가 고파 코고는 소리에 모두가 잠이 든 것을 확인한 후, 냉장고 앞에서 밥과 반찬을 급하게 꺼내 허겁지겁 먹었다. 그리고 난 기절했다. 코고는 소리는 여전히 내 귀에 들린채. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-08 17:12:21.028051',23,48,'산행','어릴 적 산에서 조난당했을 때 구조해준 아저씨를 기억하지 못한 채 살아온 남자는, 산에서 반복적으로 마주치는 노인을 통해 그때 은인을 떠올리게 된다. 그 은인이 산에 오르지 못할 나이가 되기 전, 감사 인사를 전하고자 매일 그 산에 오르며 기다리는 것이다.','남자는 산행을 하다 죽을 뻔했다. 하지만 남자는 그 일을 잊을만도 한 20년 뒤, 어째선지 매일매일 그 산을 등산하고 있다. 가족들이 죽을 뻔 한 것을 잊었느냐고 물었지만 남자는 기억함에도 그 산을 올라야 한다고 한다. 남자는 왜 산행을 할까?','ORIGINAL',NULL),('2025-08-08 17:13:15.935768',23,49,'과학실험','시간이 멈췄기 때문에 아무도 반응을 하지 않은 것이었다.','한 과학자가 중대한 실험을 했다. 결과는 대성공이었지만, 다른 학자들이 전혀 반응을 하지 않았다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-11 04:17:22.715810',36,53,'단골 카페의 비밀 주문서','그 주문서는 실제로 범죄자가 사용하는 암호화된 신호였다. 평소 주문에 섞인 숫자와 기호는 범죄 조직 간에 물품 인도 장소와 시간을 알리는 비밀 신호였으며, 주문서가 바뀐 것은 작전 변경을 알리는 메시지였다. 카페는 이 과정에서 무심코 범죄 조직의 전달 매개체 역할을 해왔던 것이다.','작은 동네 카페에서 매일 같은 시간, 같은 사람이 항상 특별한 주문을 한다. 그런데 어느 날, 카페 주인은 그 사람이 주문하는 방식과 내용이 갑자기 바뀌었다는 것을 알게 되었다. 주문서에는 평소와 다른 숫자와 기호가 적혀 있었는데, 카페 주인은 그 주문이 단순한 음료 주문이 아닐 수도 있다고 의심한다. 이 주문서는 과연 무엇을 의미하는 것일까요?','CUSTOM',NULL),('2025-08-13 16:06:50.221477',211,54,'사라진 피자 배달부의 비밀','배달부는 실은 이웃들에게 몰래 자신의 코미디 공연 초대장을 전하기 위해 피자 박스에 메시지를 적어 배달한 것이었습니다. 주문자들은 모두 이중극장에 참석하는 친구들이었고, 배달부는 공연 시작과 함께 무대 뒤로 사라져 공연을 준비하고 있었던 것입니다. 즉, 배달부가 사라진 것은 피자를 배달하면서 동시에 코미디 쇼를 알리는 비밀 임무를 수행했기 때문입니다.','한밤중, 한 동네에서 피자 배달부가 주문한 피자를 전부 배달하지 못하고 사라졌습니다. 그런데 주문자들은 모두 피자를 받고 집에 있었으며, 배달부는 휴대폰도 집도 찾을 수 없었습니다. 심지어 배달한 피자 박스에도 이상한 메시지가 적혀 있었는데요, 배달부가 갑자기 사라진 이유는 무엇일까요?','CUSTOM',NULL),('2025-08-16 02:11:59.424850',-1,55,'사라진 보물의 마지막 위치','마리아는 사실 사원의 위치를 단순한 전설로 여기는 이들을 속이기 위해 일부러 자신의 흔적을 지우고, 주변에 상형문자 돌조각을 배치해 혼란을 주었습니다. 그녀가 보물을 찾는 데 도움을 받은 것은 그녀의 어릴 적 스승으로부터 전해 받은 암호화된 지도였으며, 미로 같은 정글길 또한 그 지도에 따른 최적의 경로였습니다. 즉, 마리아는 홀로 보물을 찾은 것이 아니라 오랜 준비와 비밀스러운 지도를 토대로 계획적으로 움직인 것이었습니다. 이러한 점이 외부에서는 전혀 감지되지 않았기에 그녀가 어떻게 보물을 찾았는지 모두 의문을 품게 된 것입니다.','탐험가 마리아는 전설 속에만 존재하는 \'잃어버린 사원의 보물\'을 찾아 깊은 정글을 탐험하던 중, 갑자기 그녀가 남긴 모든 흔적이 사라졌습니다. 주변에는 흔히 볼 수 없는 기이한 상형문자가 새겨진 돌조각과 미로 같은 길만 남아 있었죠. 하지만 마리아는 절대 혼자가 아니었고, 누군가 그녀를 도왔다는 증거도 전혀 없었습니다. 도대체 마리아는 어떻게 보물의 위치를 알 수 있었던 걸까요?','AI',_binary ''),('2025-08-16 18:59:28.792214',-1,56,'닫힌 방 속의 사라진 그림자','그림은 실제로 사라진 것이 아니라, 화가가 고의로 그림의 일부를 투명한 소재로 제작해, 빛과 그림자의 효과를 이용해 작품이 벽과 하나로 녹아들게 만든 것이었습니다. ‘사라진 그림자’는 그림자가 아니라 그림의 일부였고, 작업실 내부 조명의 각도와 특수 코팅 덕분에 그림이 보이지 않는 착시를 만들어 낸 것입니다. 즉, 그림은 물리적으로는 존재했으나 눈에 보이지 않도록 숨겨진 셈입니다.','어느 날, 유명한 화가의 작업실에서 그의 최신 작품이 완성되기 전 사라졌습니다. 작업실은 창문과 문이 모두 잠긴 상태였고, 아무도 출입한 흔적이 없었습니다. CCTV에는 화가 혼자 있는 모습만 담겨 있었고, 작품이 있던 벽에는 이상한 그림자만 남아 있었습니다. 도대체 그림은 어떻게 사라질 수 있었을까요?','AI',NULL),('2025-08-16 18:59:30.406064',-1,57,'사라진 범인의 그림자','사건의 핵심은 도둑이 사람 형태의 그림자가 아닌, 자동으로 작동하는 드론 형태로 침입했다는 점이다. 드론은 건물 내 감시 사각지대를 이용해 귀중품을 훔친 뒤, 무선으로 원격 조종되었다. CCTV가 사람의 움직임만 감지하도록 설정되어 있어 드론의 출입은 기록되지 않았고, 경비원들도 드론 출입을 몰랐다.','한 고급 레스토랑에서 귀중품이 도난당했다. CCTV에는 아무도 출입하지 않은 것으로 나왔고, 경비원들도 모두 현장에 있었다. 하지만 아무도 없었던 그 시간에 어떻게 도둑이 침입할 수 있었을까요?','AI',NULL),('2025-08-17 00:08:52.433062',23,58,'선인장','그 남자는 사막에서 길을 잃고 헤매던 중, 같은 장소를 계속 돌고 있다는 의심을 품었다. 확인을 위해 종이조각을 선인장에 꽂고 다시 걸었는데, 결국 그 종이조각을 다시 발견하고 절망에 빠져 자살한 것이다.','한 남자가 사막에서 종이조각 하나를 본 뒤 총으로 자살했다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-17 00:10:05.572514',23,59,'가까스로 피한 사고','사건이 발생한 시점은 낮입니다.','두 남자가 헤드라이트를 끈 채 서로를 향해 운전하고 있습니다. 달도 별도 보이지 않고 근처 어디에도 전등은 켜지지 않았습니다. 심지어 두 차량 모두 검정색으로 칠해져 있습니다. 그러나 두 사람 모두 언제 브레이크를 밟아야 하는지 알고 있으며 간신히 서로 충돌을 피합니다. 어떻게 이것이 가능했을까요?','ORIGINAL',NULL),('2025-08-17 00:14:23.151862',23,60,'식기 도둑','범인은 회전 초밥 가게에 들어간 뒤 사람 눈을 속여 비싼 접시를 자기 가방에 넣었다. 그리고 점원을 불러 계산. 이렇게 도둑은 낼 돈을 속였다. 훔친 접시는 밖에 나가서 들키지 않도록 파기.','비싼 식기를 훔치고 나서 그걸 바로 버려 버리는 사람. 왜 그런 짓을 했을까?','ORIGINAL',NULL),('2025-08-17 00:15:44.414618',23,61,'복면을 쓰고 도망간 도둑','거실에는, 온 몸이 피투성이가 되어 있는 부모님과 동생의 시체가 누워 있었다.\n\n내가 가족을 죽인 후 씻고 나온 새에 도둑이 들어버린 상황..\n\n도둑은 그 사실을 알고 바로 도망쳐버린 것이다.','욕실에서 샤워하고 있는데, 주방 쪽에서 비명소리가 들렸다.\n\n놀란 나는 대충 타올을 걸치고 서둘러 주방으로 나갈 수 밖에 없었다.\n\n복면을 쓴 사람은 나를 보자마자 후다닥 창문 밖으로 뛰어 나가 버렸고\n\n나는 활짝 열린 창문을 바라보며 새파랗게 질린채 주저앉았다.\n\n무슨 일이 있었을까?','ORIGINAL',NULL),('2025-08-17 00:16:59.965889',23,62,'7층까지 가는 10층 거주민','주인공은 키가 작았고 발돋움을 하여도 키가 7층 버튼까지만 닿아서 어쩔 수 없이 7층에서 내려 걸어올라갑니다. 가끔씩 다른 사람들과 타거나 비 오는 날에는 우산을 이용해 10층 버튼을 누르는 게 가능하지요.','건물의 10층에서 살고 있는 사람이 있습니다. 이 사람은 매일 엘리베이터를 타고 내려와 직장에 가거나 쇼핑을 하는 등 일상생활을 자유롭게 합니다. 하지만 이 사람이 10층에 있는 자기 집에 돌아올 땐 보통 7층에서 내려 나머지 층을 계단을 통해 올라갑니다. 운동을 싫어하는 성격인데 왜 이런 행동을 하는 걸까요?','ORIGINAL',NULL),('2025-08-17 00:17:51.664769',23,63,'간단한 수술','간호사가 얘기한 대상은 환자가 아니라, 수술을 담당하는 의사였다. 처음 수술하는 의사가 불안해하자 간호사가 간단한 수술이라며 안심시키려 한 것.','한 환자가 수술을 앞두고 있다. 간단한 수술로 알고 있어 걱정하지 않았다. 그런데 수술실에 들어가기 전 간호사가 한 \"간단한 수술이니까 걱정하지 마세요\"라는 말을 듣고 불안해지기 시작했다. 왜 그랬을까?','ORIGINAL',NULL),('2025-08-17 00:21:08.377898',23,64,'일요일의 취미생활','사진을 찍으며 범죄 현장을 찍게 되었고, 범인은 그 사진에 자신이 찍혔다고 생각해 주인공을 살해했다.','화창한 일요일 오후, 주인공은 취미생활을 위해 사진을 찍으며 공원을 산책했다. 며칠 뒤 주인공은 시체로 발견되었다. 사건의 전말은?','ORIGINAL',NULL),('2025-08-17 00:24:29.018023',23,65,'잃어버린 생일 케이크','그 남자는 최근 이사했고, 이 사실은 극히 일부 사람만 알고 있었다. 그런데 상자에 적힌 배송 주소는 정확히 새 집이었고, 받는 사람 이름도 맞았으며, 심지어 그가 생일이라는 사실까지 적혀 있었다. 그는 아무에게도 새 주소나 생일을 알린 적이 없었기 때문에, 누군가 자신을 감시하고 있음을 직감하고 즉시 경찰에 신고한 것이다.','한 남자가 생일에 도착한 택배 상자를 열어본 후, 바로 경찰에 신고했다. 상자 안에는 그의 이름이 적힌 케이크가 있었고, 아무런 손상도 없었다. 그런데도 그는 이를 보고 범죄를 직감했다. 왜일까?','ORIGINAL',NULL),('2025-08-17 00:25:38.744978',23,66,'한밤중의 피아노','피아노는 자동 연주 기능이 있는 전자 피아노였고, 타이머 설정이 되어 있었다. 연습생 중 한 명이 몰래 설정해 두고 도망쳤다.','매일 밤 12시, 아무도 없는 연습실에서 피아노 소리가 들린다. 관리인은 분명 전날 모든 문을 잠그고 나갔는데도 말이다. 어떻게 이런 일이 가능할까?','ORIGINAL',NULL),('2025-08-17 00:26:28.321460',23,67,'무언의 전화','그는 오래 전 살인을 저질렀고, 피해자의 시계가 멈춘 시각이 매일 전화가 걸려오는 시각과 같았다. 그는 누군가 자신이 범인이라는 걸 알고 있다는 걸 직감하고 자수했다.','한 남자가 매일 같은 시각, 벨만 울리고 아무 말도 없는 전화를 받았다. 그는 결국 스스로 경찰에 자수했다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:27:34.917148',23,68,'의문의 기부','그는 어릴 적 그 고아원에서 학대를 받았고, 후에 자신이 그것을 밝히려다 범죄자가 되었다. 고아원을 미끼로 경찰을 유인한 것이다.','한 무명의 사람이 고아원에 거액을 기부하고 사라졌다. 며칠 후, 그는 수배자로 밝혀졌다. 그는 왜 고아원에 기부한 걸까?','ORIGINAL',NULL),('2025-08-17 00:27:53.874024',23,69,'고양이의 밤산책','고양이 목걸이에 몰래 녹음기를 달아 범죄 현장의 대화를 녹음하게 만든 스파이 작전 중이었다.','매일 밤마다 고양이가 밖에 나갔다 돌아오면 주인이 불안해한다. 고양이는 아무 일도 없었다는 듯 자고만 있는데도. 왜일까?','ORIGINAL',NULL),('2025-08-17 00:28:27.789588',23,70,'거울 속의 얼굴','거울 뒤에 설치된 카메라로 그녀를 감시하던 누군가가 거울을 교체해 버린 것이었다. 거울이 새것으로 바뀐 걸 본 여자가 이를 눈치챈 것이다.','여자는 매일 아침 거울을 보며 화장을 한다. 그런데 어느 날, 거울 속 얼굴이 약간 다르게 보이자 그녀는 바로 경찰에 신고했다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:29:06.895678',23,71,'멈춰버린 시계','그 시간은 그가 아내를 사고로 잃은 정확한 시각이었다. 그날 이후 시계를 일부러 고치지 않은 채 간직하고 있던 것이다.','남자의 시계는 6시 15분에 멈춰 있었고, 그는 그것을 보고 눈물을 흘렸다. 왜일까?','ORIGINAL',NULL),('2025-08-17 00:29:38.800610',23,72,'분실된 카메라','카메라에는 여행 중 혼자만 알고 있던 장소에서 찍은 사진이 있었다. 누군가 그 사진을 보고, 그의 위치를 알고 있었다는 뜻이었기 때문이다.','여행에서 돌아온 남자는 카메라를 잃어버린 걸 알고 놀랐다. 그런데 그 다음 날, 택배로 카메라가 도착했다. 그리고 그는 경찰에 신고했다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:29:57.091394',23,73,'잠긴 목욕탕','시체는 오래 전 실종된 사람이었고, 목욕탕이 폐쇄되기 전에 이미 안에 있었다. 그 뒤로 아무도 열지 않았던 것이다.','사람들이 찾지 않는 오래된 목욕탕에서 죽은 시체가 발견되었다. 아무도 들어가지 않았고, 문도 잠겨 있었다. 어떻게 시체가 있었을까?','ORIGINAL',NULL),('2025-08-17 00:30:23.437563',23,74,'눈 떠보니 낯선 방','그는 마술사였고, 관 속 탈출 훈련 중이었다. 방은 실제로는 무대 세트의 일부였다.','한 남자가 눈을 떴을 때 자신이 알지 못하는 방에 있었다. 문은 잠겨 있었고, 창문은 없었다. 그런데 그는 바로 웃었다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:30:50.939081',23,75,'남겨진 쪽지','쪽지의 필적은 사망자와 일치하지 않았다. 누군가 죽인 후 자살처럼 꾸민 것이었다.','유서도 없이 사망한 사람의 방에서 단 하나의 쪽지만 발견되었다. 그 안에는 ‘미안해’라는 글자만 있었다. 경찰은 이를 타살로 판단했다. 왜?','ORIGINAL',NULL),('2025-08-17 00:31:06.833451',23,76,'사진 속 손가락','그는 셀프 타이머를 사용해 사진을 찍었다. 프레임 안에 누군가 손가락이 있다는 건, 그 외에 누군가 방 안에 있었다는 뜻이었다.','한 남자가 찍은 가족 사진을 보다가 멈췄다. 사진 속엔 아무도 없는데 손가락 하나가 프레임 한쪽에 살짝 보였다. 그는 경찰에 신고했다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:32:54.862295',23,77,'어긋난 예고','남자는 사형수였고, 예정일보다 집행이 하루 앞당겨졌다.','한 남자가 자신은 내일 죽을 거라고 말했다. 그런데 그날 밤 그는 사망했다. 왜?','ORIGINAL',NULL),('2025-08-17 00:33:37.263198',23,78,'방향을 바꾼 차','자율주행차였고, 시스템이 해킹당해 경로를 변경한 것이다.','사람이 없는 도로에 주차된 차가 갑자기 방향을 바꿔 다른 길로 향했다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:33:49.973424',23,79,'기억하지 못한 전화','여자는 수면 중이었고, 꿈속에서 전화를 받은 것이다.','여자가 친구와 통화를 마친 후, 그 통화를 기억하지 못했다. 그런데 친구는 확실히 통화했다고 한다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:34:01.915897',23,80,'파란 약','그는 정신병원에 다시 강제로 입원시키려는 조치임을 알아차린 것이다.','병원에서 파란 약을 받은 남자는 그것을 보고 도망쳤다. 왜?','ORIGINAL',NULL),('2025-08-17 00:34:19.188182',23,81,'피묻은 편지','그는 실종된 아이의 혈액형과 필체를 편지에서 확인했고, 아이가 아직 살아 있음을 알게 된 것이다.','한 남자가 피가 묻은 편지를 받고 눈물을 흘렸다. 그런데 그 편지는 누가 쓴 것인지 알 수 없었다. 이유는?','ORIGINAL',NULL),('2025-08-17 00:36:16.515878',23,82,'무인도에서 온 편지','그 편지는 과거 실종된 친구가 보낸 것이었는데, 친구는 이미 죽은 것으로 알려져 있었다. 즉, 누군가 친구 행세를 하고 있었다.','한 남자는 무인도에서 구조 요청 편지를 받았지만 구조를 보내지 않았다. 왜?','ORIGINAL',NULL),('2025-08-17 00:36:36.825072',23,83,'식지 않는 커피','컵 밑에 발열 장치가 몰래 설치되어 있었다. 누군가를 미행하며 독을 숨기기 위한 장치였던 것이다.','카페 직원이 손님에게 커피를 건넸는데, 몇 시간 후에도 식지 않았다. 손님은 경찰을 불렀다. 왜?','ORIGINAL',NULL),('2025-08-17 00:37:03.130430',23,84,'마지막 승객','그 손님은 살인범이었고, 기사에게 협박해 탈출에 협조하게 만든 것이다.','마지막으로 택시에 탄 손님은 아무 말 없이 목적지로 가자고 했다. 도착 후 기사도 아무 말 없이 차를 떠났다. 왜?','ORIGINAL',NULL),('2025-08-17 01:03:25.594145',-1,85,'전쟁터의 침묵','두 나라 지도자들은 서로의 국민들에게 전쟁 상황을 계속 알리면서, 동시에 비밀 협정을 맺어 실제 전투를 중단함으로써 불필요한 피해를 막으려 했습니다. 이는 내부 반란 가능성을 줄이고, 양국 모두 경제적 어려움을 극복하기 위한 임시 방편이었습니다. 국민들은 아직 적을 증오하고 있었기에 평화 소식이 알려지면 지도자들의 권위가 약해질 것을 우려해 이 평화는 비밀에 부쳐진 것이었습니다.','두 적대국 군대가 접경지역에서 갑자기 전쟁을 멈추고 함께 평화 협정을 맺어 버렸습니다. 이전까지는 서로를 향해 포탄을 쏘던 상황이었지만, 어느 날 밤 모든 전투가 중단되었죠. 더욱 놀라운 것은, 양쪽 모두 자국 국민들에게 전쟁이 계속되고 있다고 알리며 평화 협정을 비밀로 유지했다는 사실입니다. 왜 그랬을까요?','AI',_binary ''),('2025-08-17 17:39:06.306793',25,86,'아침에 사라진 커피 한 잔의 비밀','지훈이 놓아둔 커피 컵은 단열 컵이었고, 뚜껑이 꽉 닫혀 있어 외부로 커피가 쏟아질 수 없었습니다. 사실 지훈 자신이 잠결에 컵을 들고 화장실에 가다가 컵 안의 커피를 화장실 싱크대에 몰래 버린 것이었고, 다음 날 아침에 그 사실을 깜빡한 채 사라진 커피를 의아해한 것이 문제의 핵심입니다. 즉, 커피는 사라진 것이 아니라 지훈 본인이 무의식중에 이동시키고 버린 것이었습니다.','지훈은 매일 아침 같은 시간에 커피 한 잔을 준비해 책상 위에 놓아둡니다. 하지만 어느 날, 커피가 놓여있던 자리에는 한 방울도 남아있지 않고 컵은 깨끗하게 비워져 있었습니다. 집에는 지훈 혼자 있었는데, 커피는 도대체 어디로 사라진 걸까요?','CUSTOM',_binary '\0'),('2025-08-17 17:40:23.790458',25,87,'사라진 마법사의 그림자','마법사의 그림자는 그의 마법 에너지 저장고 역할을 했는데, 그림자를 훔쳐간 건 그의 오랜 라이벌이었습니다. 라이벌은 그림자 속에 숨어있는 마법 에너지를 빼내어 자신의 힘을 키우려 했던 것입니다. 그림자가 사라지면서 마법사의 힘이 약화된 것이었습니다.','한 마을의 유명한 마법사가 어느 날 갑자기 자신의 그림자만 사라진 채 모습을 드러냈습니다. 그림자는 늘 그와 함께 움직였고, 마법 에너지와도 연결되어 있었습니다. 하지만 그날부터 그는 힘을 거의 쓸 수 없게 되었죠. 왜 마법사의 그림자가 사라졌을까요?','CUSTOM',_binary '\0'),('2025-08-17 18:10:34.649252',324,88,'사라진 증거, 사라진 기억','목격자는 실제로 기억을 잃은 것이 아니라, 범죄의 공범이었다가 양심의 가책으로 진실을 숨기기 위해 일부러 기억을 잃은 척한 것이다. 증거물이 사라진 것은 그가 말하지 못하게 하기 위한 공범의 조작이며, 그의 기억상실 주장은 범죄를 은폐하려는 교묘한 위장술이었다.','한 유명한 범죄 현장에서 결정적인 증거물이 사라졌다. 사건 당일, 현장에 있던 유일한 목격자는 심한 충격으로 기억을 잃었다고 주장한다. 경찰은 목격자를 심문했지만, 그가 진실을 숨기고 있다는 의심이 든다. 목격자는 왜 기억을 잃었을까요?','CUSTOM',_binary '\0');
